window.bookSummaryJSON = "<p>The next novel in the Seraphim series following <i>Skyborn</i> from <i>USA Today</i> best-selling author, David Dalglish.</p> <p>Bree and Kael Skyborn have seen their island invaded, their Seraphim disbanded, and their royal family imprisoned.</p> <p>A rebellion grows from the ashes, demanding Bree to be their Phoenix, their symbol against Center's tyranny, and for Kael to find the doomsday prophet Johan and sway his cult to their side.</p> <p>Should they fail, the hope of their rebellion fails with them.</p>"; 
